pragma solidity ^0.4.17;



contract Declaracion {

    struct Persona {
        string RFC;
        string declaracion; 
        string ano;
        string tipo; 
        string hashDoc;
        uint index;
    }

    mapping(address => Persona) private perStructs;
    address[] private perIndex;


    function isPersona(address perAddress) public constant returns(bool) {
        if(perIndex.length == 0) return false;
    return (perIndex[perStructs[perAddress].index] == perAddress);
    }

    function setDeclaracion (address perAddress,string _RFC,string _declaracion, string _ano, string _tipo, string _hashDoc) public{

        perStructs[perAddress].RFC  = _RFC;
        perStructs[perAddress].declaracion = _declaracion;
        perStructs[perAddress].ano = _ano;
        perStructs[perAddress].tipo = _tipo;
        perStructs[perAddress].hashDoc = _hashDoc;
        perStructs[perAddress].index   = perIndex.push(perAddress)-1;
    }

    function getDeclaracion (address perAddress) public constant returns(address, string, string, string, string, string){
        if(!isPersona(perAddress)) revert();
        return( perAddress,
                perStructs[perAddress].RFC,
                perStructs[perAddress].declaracion,
                perStructs[perAddress].ano,
                perStructs[perAddress].tipo,
                perStructs[perAddress].hashDoc);
    }
}
